import React from "react";
import "../../about_page_style.css";
import "../../shop_page_style.css";
const Shop = () => {
  return (
    <div>
      <section className="height_video_fullscreen background_shop p-0">
        <div className="position-relative w-100 z_index_1 padding_x_high height_video_fullscreen backgroud_dark_opacity">
          <h1 className="text-light font_weight_boldest head_line_height head_size_high padding_top_10">
            SHOP SINGLE
          </h1>
          <span className="font_family_span font_color_span head_span_size_normal mb-5 font_weight_normal">
            ~ Delicious food ~
          </span>
        </div>
      </section>
      <section>
      <div className="sp-loading"><img src="images/sp-loading.gif" alt="" /><br />LOADING IMAGES</div>
		<div className="sp-wrap">
			<a href="images/1.jpg"><img src="images/1_tb.jpg" alt="" /></a>
			<a href="images/2.jpg"><img src="images/2_tb.jpg" alt="" /></a>
			<a href="images/3.jpg"><img src="images/3_tb.jpg" alt="" /></a>
			<a href="images/4.jpg"><img src="images/4_tb.jpg" alt="" /></a>
			<a href="images/5.jpg"><img src="images/5_tb.jpg" alt="" /></a>
			<a href="images/6.jpg"><img src="images/6_tb.jpg" alt="" /></a>
		</div>
      </section>
    </div>
  );
};

export default Shop;
